__NUXT_JSONP__("/drugs/Akt_Inhibitor_MK2206", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1032349-93-1",chebiId:b,chemicalFormula:b,definition:"An orally bioavailable allosteric inhibitor of the serine\u002Fthreonine protein kinase Akt (protein kinase B) with potential antineoplastic activity. Akt inhibitor MK2206 binds to and inhibits the activity of Akt in a non-ATP competitive manner, which may result in the inhibition of the PI3K\u002FAkt signaling pathway and tumor cell proliferation and the induction of tumor cell apoptosis. Activation of the PI3K\u002FAkt signaling pathway is frequently associated with tumorigenesis and dysregulated PI3K\u002FAkt signaling may contribute to tumor resistance to a variety of antineoplastic agents.",fdaUniiCode:"51HZG6MP1K",identifier:"C90581",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C155764"],synonyms:["1,2,4-Triazolo(3,4-f)(1,6)naphthyridin-3(2H)-one, 8-(4-(1-aminocyclobutyl)phenyl)-9-phenyl-",c,"Akt inhibitor MK2206","MK 2206","MK-2206","MK-2206 FREE BASE","MK2206"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAkt_Inhibitor_MK2206",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Akt_Inhibitor_MK2206","","Akt Inhibitor MK2206","2021-10-30T13:47:12.523Z")));